import { maps2 } from "../notes"
export var maps = [];

for (var city of maps2) {
  for (let i = 0; i < city.neighbor_cities.length; i++) {
    if(city.neighbor_cities[i].is_active == true){
      maps.push(
        {
          "startCity" : city.city_name,
          "finishCity" : city.neighbor_cities[i].city_name,
          "distance" : city.neighbor_cities[i].distance
        },
      )
    }
  }
}
console.log("maps loaded");
console.log(maps)
console.log("maps length : "+maps.length)

